import "./../App.css";

/*
    Component that has the settings card which will display
    the name, description and options for an individual setting
*/
class Setting extends Component {
    constructor(name, description) {
       super(); 
       this.name = name;
       this.description = description;
    }

    render() {
        return(
            <div>
                <h3>{this.name}</h3>
                <p>{this.description}</p>
            </div>
        );
    }
}

export { Setting }
